window.bookSummaryJSON = "<p>Things I have learned since arriving in Avalon:</p> <p>1. I am a fae</p> <p>2. I am an empath</p> <p>3. I am collecting hot-AF fae boyfriends like they're going out of style</p> <p>4. My two dads are both kind of jerks</p> <p>After 20 years as a not-quite-human, wondering where I belong, I've finally found my place among the fae in Avalon, and my dads want to take it away. All I want to do is avoid my family, stay under the radar, learn about my magic, and get up close and personal with my suitors. But, of course, the gods have other plans for me. Change-the-world-save-the-fae kinds of plans. Turns out I'm not really a save-the-world kind of girl. Honestly, I don't want any of this.</p> <p><b>Contains mature themes.</b></p>"; 
